import ImageOne   from '../Images/HighlightItems/Hamburger.jpg';
import ImageTwo   from '../Images/HighlightItems/pizza.jpg';
import ImageThree from '../Images/HighlightItems/sandwich.jpg';

export const SliderData=[
    {
        title: 'Hamburger',
        price: '20$',
        path : '/homes',
        label: 'View Home',
        image: ImageOne,
        alt  : 'Hamburger'
    },
    {
        title: 'Pizza',
        price: '20$',
        path : '/homes',
        label: 'View Home',
        image: ImageTwo,
        alt  : 'Hamburger'
    },
    {
        title: 'Sandwich',
        price: '20$',
        path : '/homes',
        label: 'View Home',
        image: ImageThree,
        alt  : 'Hamburger'
    }
]
